/* google calendar */
@-moz-document url-prefix(http://www.google.com/calendar) {

div.cal-gaia-bar#guser {background-color: transparent !important; color: #000000 !important; margin-top:20px !important}
div.cal-gaia-bar#guser b {color: #af0000 !important; line-height: 10px !important}
div.cal-gaia-bar#guser a.lk{width: 150px !important; position: relative !important; top: 5px !important}
div.cal-gaia-bar#guser a.lk[href*="support/calendar"]{position:relative !important; top: -5px !important}
div.cal-gaia-bar#guser a.lk[href="logout"]{position:relative !important; top: -16px !important} 

table#mothertable{margin-top: 8px !important}
#topBar td#mt1 div, #topBar #mt2>div {background-color: #000000 !important}
div.printborder#chrome_main2{border-left: 0px !important}
div.printborder, div.eventborder, div#cover{background-color: #cc6666 !important; color: #000000 !important}

span.lk#show_search_opts{position: relative !important; top: -0.8em !important; left: 0.3em !important; background-color: #ff9e00 !important; font-size: 90% !important}
span.lk[onclick="iH();"]{position: relative !important; top: -2.7em !important; left: -23em !important; background-color: #ff9e00 !important; font-size: 90% !important}

/* links top */
td#printlink .lk {color: #2152c3 !important}
.modelinkOn * {color: #af0000 !important}
.modelinkOff * {color: #ffd978 !important}
td#printlink .lk, .modelinkOn *, .modelinkOff *, th.datecell a{text-transform: lowercase !important; font-variant: small-caps !important; text-decoration: none !important;}
td#printlink .lk:hover, .modelinkOn *:hover, .modelinkOff *:hover {color: #ff9e00 !important}

/* navbar left */
td#nav{border: solid 15px #cc6666 !important; border-right: none !important; background-color: #000000 !important;
-moz-border-radius-topleft: 15px !important; -moz-border-radius-bottomleft: 15px !important; padding-left: 5px !important} 
td#nav div#nt_0 div{background-image: none !important}
td#nav div#dp_0_t2, td#nav #dp_0, td#nav #nb_0, td#nav #dp_0_b2 {background-color: #000000 !important; border-color: #ff0000 !important}
td#nav #dp_0_t1{color: #9966ff !important}
td#nav div#dp_0_t1, td#nav div#dp_0, td#nav div#dp_0_b1, td#nav div#dp_0_b2, td#nav div#np_0{background-color: #cc6666 !important}
#nt_0, div#lhscalinner, div#calendarsBottomChrome2, td#nav div#nb_0 div div#calendarsBottomChrome1, td#nav div#nb_0 div div#calendarsBottomChrome2 
{background-color: #9e6160 !important; color: #000000 !important;} 
#addPT * {background-color: #9e6160  !important; color: #000000 !important;} 
#addP, #addP * {background-color: #ff9e00 !important; color: #000000 !important; border-color: #ff0000 !important} 
.addmenu *:hover{background-color: #428dc9 !important} 

/* date picker */
td#nav .datePickerDiv .DP_heading * {color: #9966ff !important} 
td#nav .datePickerDiv .DP_days * {color: #ffcf60 !important}
td#nav .datePickerDiv .DP_weekday {color: #428dc9 !important}
td#nav .datePickerDiv .DP_weekend {color: #ff0000 !important}
td#nav .datePickerDiv .DP_weekday_selected {color: #ffffff !important}
td#nav .datePickerDiv .DP_weekend_selected {color: #ffffff !important}
td#nav .datePickerDiv .DP_today {background-color: #af0000 !important; color: #000000 !important}
td#nav .datePickerDiv .DP_today_selected {background-color: #ff0000 !important; color: #000000 !important}
td#nav .datePickerDiv .DP_weekday:hover, td#nav .datePickerDiv .DP_weekend:hover,
td#nav .datePickerDiv .DP_weekday_selected:hover, td#nav .datePickerDiv .DP_weekend_selected:hover
{color: #ff9e00 !important}

/* main cell */
td#maincell{background-color: #000000 !important}
td#maincell{border: solid 15px #cc6666 !important; border-right: none !important; border-left: none !important; padding-left: 5px !important} 
td#maincell #mainbody #co #chrome_main1 * {background-color: #000000 !important}
td#maincell #mainbody #co #chrome_main4, td#maincell #mainbody #co #chrome_main5{background-color: #cc6666 !important}
td#maincell #mainbody #co #chrome_main6, td#maincell #mainbody #co #chrome_main7{background-color: #000000 !important}
td#maincell #mainbody #co #chrome_main2 #colheaders .cheadToday {background-color: #ff9e00 !important;}
td#maincell #mainbody #co #chrome_main2 #allDayGrid {background-color: #000000 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #rowheadcell * {background-color: #cc6666 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #gridcontainercell #grid #decowner {background-color: #000000 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #gridcontainercell #grid #decowner .currentDayDec {background-color: #af0000 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid {background-color: #261818 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid #decowner {background-color: #000000 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid #decowner .dayOfMonth {background-color: #9299cf !important; color: #ff0000 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid #decowner .dayOfMonth * {color: #30309e !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid #decowner .currentDayDec {background-color: #af0000 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid #eventowner .month_event * {color: #ffff99 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid #eventowner .month_event *:hover {color: #ff9e00 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid #eventowner .moreevents {color: #00ffff !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #calowner .grid #eventowner .moreevents:hover {color: #ff0000 !important}
td#maincell #mainbody #co #chrome_main2 #colheaders * {color: #000000 !important;}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #rowheadcell * {color: #000000 !important;}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #eventowner dd *{color: #000000 !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer #eventowner dl .timelabel{color: #000000 !important}

/* agenda links */
.newdate a.event-title, .firstevent a.event-title, .lastevent a.event-title{color: #668cd9 !important; background-color: transparent !important}

.cal1 a.event-title {color: #ff0000 !important}
.cal6 a.event-title {color: #0000ff !important}
.cal8 a.event-title {color: #00ff00 !important}
.cal9 a.event-title {color: #ffff00 !important}
.cal10 a.event-title{color: #ff00ff !important}
.cal11 a.event-title{color: #00ffff !important}
.cal12 a.event-title{color: #ffffff !important}

.cal2 a.event-title {color: #dd4477 !important}
.cal3 a.event-title {color: #994499 !important}
.cal4 a.event-title {color: #6633cc !important}
.cal5 a.event-title {color: #336699 !important}
.cal7 a.event-title {color: #ee8800 !important}
.cal13 a.event-title{color: #22aa99 !important}

th.day, th.datecell {background-color: #000000 !important}
th.datecell a {color: #ffcf60 !important}
th.datecell a:hover {color: #ff9e00 !important}

/* create event dialog */
div.eventborder{margin-top:5px !important; margin-left:8px !important}
td#maincell #cover #co, #maincell #cover #co div div {background-color: #000000 !important}
td#maincell #cover #co div {border-color: #9966ff !important}
td#maincell #mainbody #co #chrome_main2 * {border-color: #30309e !important}
td#maincell #mainbody #co #chrome_main2 #gridcontainer * {border-color: #9966ff !important}

.m1, .m2, .m3, .m4{background-image: none !important}
h2.header {background-color: #000000 !important; 
background-image: url("data:image/gif;base64,R0lGODlhCQAJAIABAK8AAP///yH5BAEAAAEALAAAAAAJAAkAAAINjI95wN3hnolJVoVzKAA7")!important}
p.actions{background-color: #000000 !important}

td.titlecell + img.webContent { background-color: transparent !important} 

/* Buttons color and position */

span.lk#comp b, span.lk#open-quick-add{background-color: #2153c3 !important}
a.lk#btcb_top, a.lk#btcb_btm{background-color: #ffcf60 !important}
button#detailSubmitButtonTop, button#efcb_top{background-color: #2153c3 !important}
button#detailSubmitButtonBtm, button#efcb_btm{background-color: #30309e !important}

button#efcb_top:hover, button#efcb_btm:hover, button#detailSubmitButtonTop:hover, button#detailSubmitButtonBtm:hover,
a.lk#btcb_top:hover, a.lk#btcb_btm:hover, span.lk#comp b:hover, span.lk#open-quick-add:hover
{background-color: #ff9e00 !important; color: #000000 !important}

span.lk#comp b, span.lk#open-quick-add{display: block !important; width: 80px !important; height: 20px !important; text-decoration: none !important}
a.lk#btcb_top{padding-top: 1px !important; padding-bottom: 2px !important}

/* hide outlook bullshit */
#promo_ads { display: none !important}

img[style*="images/combined_2_0.gif"], img.navbutton
{background-image: url("data:image/png;base64,") !important}

img[src$="images/last-quarter.gif"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/png;base64,") !important}

img[src$="images/first-quarter.gif"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/png;base64,") !important}

img[src$="images/new-moon.gif"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/png;base64,") !important}

img[src$="images/full-moon.gif"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/png;base64,") !important}
}

