               url-prefix(http://www.google.fr/firefox),
               url-prefix(http://www.google.de/firefox),
               url-prefix(http://www.google.it/firefox),
               url-prefix(http://www.google.ca/firefox) {
body { background: transparent !important; }
img[src*="images/firefox"] { display: none !important}
div { background-image: none !important}
div[title="Firefox Start"],div[title="Firefox Logo"], div[title="Google"] {
background-image: url("data:image/png;base64,") !important}

input[name="btnG"] { margin-top: 1em !important}
a[href$="/firefox/community/"], a[href^="http://www.spreadfirefox.com"],
a[href^="https://addons.mozilla.org"]
